import React, { Component } from 'react';
import { BrowserRouter, Route, Router } from 'react-router-dom';
import Main from './components/main';
import Header from './components/header';

class App extends Component {
  render() {
    return (

      <switch>

        <route path="/">
            <div>
              <Main />
            </div>
        </route>
        <route path="/header">
            <div>
              <Header />
            </div>
        </route>
      </switch>
    );
  }
}

export default App;
